import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract product data from main page
    const products = await page.$$eval('.product-card', cards => 
      cards.map(card => ({
        title: card.querySelector('.product-title')?.textContent?.trim() || '',
        price: card.querySelector('.product-price')?.textContent?.trim() || '',
        rating: card.querySelector('.product-rating')?.textContent?.trim() || '',
        seller: card.querySelector('.seller-info')?.textContent?.trim() || ''
      }))
    );

    // Click on first product to open modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for product modal and take screenshot
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Extract detailed product information from modal
    const productDetails = await page.$eval('#productDetail', detail => ({
      title: detail.querySelector('.product-detail-title')?.textContent?.trim() || '',
      price: detail.querySelector('.product-detail-price')?.textContent?.trim() || '',
      description: detail.querySelector('.product-detail-description p')?.textContent?.trim() || '',
      features: Array.from(detail.querySelectorAll('.product-detail-features li')).map(li => li.textContent?.trim() || '')
    }));

    // Close product modal
    await page.click('.close');

    // Navigate to user profile using text selector
    await page.click('text=Your Profile');
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile.png'));

    // Extract user profile data
    const userProfile = await page.$eval('.profile-header', header => ({
      name: header.querySelector('h2')?.textContent?.trim() || '',
      username: header.querySelector('.username')?.textContent?.trim() || '',
      bio: header.querySelector('.bio')?.textContent?.trim() || '',
      stats: Array.from(header.querySelectorAll('.stat')).map(stat => ({
        number: stat.querySelector('.stat-number')?.textContent?.trim() || '',
        label: stat.querySelector('.stat-label')?.textContent?.trim() || ''
      }))
    }));

    // Navigate to orders using XPath
    await page.click('//a[contains(text(), "Your Orders")]');
    await page.waitForSelector('.orders-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_orders.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_orders.png'));

    // Extract order history
    const orders = await page.$$eval('.order-item', orders => 
      orders.map(order => ({
        id: order.querySelector('.order-id')?.textContent?.trim() || '',
        date: order.querySelector('.order-date')?.textContent?.trim() || '',
        total: order.querySelector('.order-total')?.textContent?.trim() || '',
        status: order.querySelector('.order-status')?.textContent?.trim() || '',
        items: Array.from(order.querySelectorAll('.order-product')).map(item => ({
          title: item.querySelector('.order-product-title')?.textContent?.trim() || '',
          price: item.querySelector('.order-product-price')?.textContent?.trim() || ''
        }))
      }))
    );

    return {
      success: true,
      action: "Extracted product data, user profile information, and order history",
      extractedData: {
        products,
        productDetails,
        userProfile,
        orders
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
